SELECT * FROM LARPredict (
  ON { table | view | (query) } AS InputTable PARTITION BY ANY
  ON model_table AS Model DIMENSION
  [ USING
    [ CoefMode ({ 'STEP' | 'FRACTION' | 'NORM' | 'LAMBDA' })]
    [ CoefPositions (coef_position [,...]) ]
    [ ResponseColumn ('response_column') ]
  ]
) AS alias;
